import React from "react";
import PlacesCard from "./PlacesCard";
import {
  Box,
  Typography,
  Button,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Chip,
  Grid,
} from "@material-ui/core";

const PlacesContainer = () => {
  return (
    <div>
      <h1>Hello</h1>
      <Grid container style={{ width: "100%" }}>
        <PlacesCard />
      </Grid>
    </div>
  );
};

export default PlacesContainer;
